import "../node_modules/bootstrap/dist/css/bootstrap.min.css"
import Navbar from './components/Navbar';

function App() {
  return (
    <div className="App">
      <Navbar />
      <h1>Casa Izvorul Raraului!</h1>
      <button className='btn btn-primary'>Button</button>
    </div>
  );
}

export default App;
